import styled from "styled-components";
import { NavLink, Link } from "react-router-dom";

//////////////////////////////////////
/*1 Nav*/
//////////////////////////////////////

const BtnContainer = styled.div`
  flex: 1;
  padding-right: 47px;
  display: flex;
  justify-content: flex-end;
`;
const BtnP = styled.div`
  padding-right: 7px;
`;
const NavBtn = styled(NavLink)`
  font-size: 1rem;
  font-family: NanumSquareB;
  cursor: pointer;
  width: 80px;
  height: 33px;

  text-decoration: none;

  display: flex;
  justify-content: center;
  align-items: center;

  border: 1px solid var(--white-two);
  border-radius: 16.5px;
  outline: none;

  color: var(--brownish-grey);

  font-size: 13.5px;

  &:hover {
    border: 1px solid var(--greenish-teal);
    color: var(--greenish-teal);
  }
`;

//////////////////////////////////////
/*2 Nav */
//////////////////////////////////////
const UserInfoContainer = styled.div`
  width: 150px;
  margin-right: 22px;
  height: 100%;
`;
const UserName = styled.div`
  color: white;
  font-size: 16.5px
  font-family: NanumSquareEB;

  height:100%;
  display:flex;
  align-items:center;
`;

const UserDepartment = styled.div`
  color: white;
  font-size: 0.6rem;
  font-family: NanumSquareB;
`;
const MoreInfo = styled.button`
  width: 17px;
  height: 37px;

  border: none;
  background: none;

  cursor: pointer;
  outline: none;
`;

const HomeNav = styled.div`
  padding-top: 17px;
  padding-left: 171px;
  display: flex;
  align-items: center;
  height: 6.64%;
`;

const NavItem = styled.div`
  font-size: 13.5px;
  color: var(--brownish-grey);
  font-family: NanumSquareB;
  margin-right: 49px;

  &:hover {
    color: var(--greenish-teal);
  }
`;

const NavClickItem = styled.div`
  font-size: 13.5px;
  color: var(--greenish-teal);
  font-family: NanumSquareB;
  margin-right: 49px;
`;
const AuthBox = styled.div`
  margin-left: 57px;
  display: flex;
`;

const MoveBtn = styled(Link)`
  font-size: 20px;
  font-family: NanumSquareEB;
  color: var(--greenish-teal);

  margin-left: 10px;
  outline: none;
  border: none;
  background: none;
  cursor: pointer;

  height: 100%;
  display: flex;
  align-items: center;

  &:hover {
    color: red;
  }
`;

export {
  BtnContainer,
  BtnP,
  NavBtn,
  UserInfoContainer,
  UserName,
  UserDepartment,
  MoreInfo,
  HomeNav,
  NavItem,
  NavClickItem,
  AuthBox,
  MoveBtn,
};
